import React from "react";
import { Routes, Route } from 'react-router-dom';

import Home from './pages/Home';
import Config from './pages/config';



export default () => {

        return (
            <Switch>
                <Route exact path="/">
                    <Home />
                </Route>

                <Route exact path="/config">
                    Página de Configurações
                </Route>
            </Switch>
        );
}
